class Solution(object):    def toGoatLatin(self, s):        """        :type S: str        :rtype: str        """        s=s.split()        count=1        news=""        for word in s:            newword=""            if word[0] in "aeiouAEIOU":                 newword=word+"ma"            else:                newword=word[1:]+word[0]+"ma"            newword+="a"*count            if count==(len(s)):                news+=newword            else:                news+=newword+" "            count += 1        return newsinput="I speak Goat Latin"s=Solution()print(s.toGoatLatin(input))